import React, { useContext } from 'react'
import { myContext } from '../context/main'

export default React.memo(function Cart() {
  const {addedItem} = useContext(myContext);
  return (
    <>
      {
        addedItem.map((item)=>{
            return item.count
        })
      }
    </>
  )
})
